 minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"119820","type":"Paragraph"},{"attributes":{"items":[{"id":"119561"},{"id":"119594"},{"id":"119624"},{"id":"119656"}],"location":"top_left"},"id":"119560","type":"Legend"},{"attributes":{},"id":"119520","type":"BasicTicker"},{"attributes":{"label":{"value":"50% do valor Normal"},"renderers":[{"id":"119728"}]},"id":"119752","type":"LegendItem"},{"attributes":{},"id":"119546","type":"BasicTickFormatter"},{"attributes":{"source":{"id":"119753"}},"id":"119757","type":"CDSView"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"119544"},"major_label_orientation":1.2,"ticker":{"id":"119660"}},"id":"119515","type":"DatetimeAxis"},{"attributes":{},"id":"119667","type":"DataRange1d"},{"attributes":{"dimension":"height","line_dash":[6],"line_width":0.5,"location":1591574400000.0},"id":"119815","type":"Span"},{"attributes":{"data":{"x":{"__ndarray__":"AABAwfsYd0IAAAAnThl3QgAAwIygGXdCAACA8vIZd0IAAEBYRRp3QgAAAL6XGndCAADAI+oad0IAAICJPBt3QgAAQO+OG3dCAAAAVeEbd0IAAMC6Mxx3QgAAgCCGHHdCAABAhtgcd0IAAADsKh13QgAAwFF9HXdCAACAt88dd0IAAEAdIh53QgAAAIN0HndCAADA6MYed0IAAIBOGR93QgAAQLRrH3dCAAAAGr4fd0IAAMB/ECB3QgAAgOViIHdCAABAS7Ugd0IAAACxByF3QgAAwBZaIXdCAACAfKwhd0IAAEDi/iF3QgAAAEhRIndCAADAraMid0IAAIAT9iJ3QgAAQHlII3dCAAAA35ojd0IAAMBE7SN3QgAAgKo/JHdCAABAEJIkd0IAAAB25CR3QgAAwNs2JXdCAACAQYkld0IAAECn2yV3QgAAAA0uJndCAADAcoAmd0IAAIDY0iZ3QgAAQD4lJ3dCAAAApHcnd0IAAMAJyid3QgAAgG8cKHdCAABA1W4od0IAAAA7wSh3QgAAwKATKXdCAACABmYpd0IAAEBsuCl3QgAAANIKKndCAADAN10qd0IAAICdryp3QgAAQAMCK3dCAAAAaVQrd0IAAMDOpit3QgAAgDT5K
